import { createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({
  palette: {
    primary: {
      main: "#ffffff",
    },
    secondary: {
      main: "#ffffff",
    },
    text: {
        primary: "#ffffff",
        secondary: "#ffffff",
        hint: rgba(256,256,256),
    },
  },
  typography: {

  }
});

export default theme;
